import { Component } from 'react'

export default class Users extends Component {
    constructor(props) {
        super(props)
        this.state = {
            users: [
                { N}
                ]
        };
    }
    render() {
        return (
            <div>
                <ul>
                    { 
                        this.state.users.map((user) => {
                            return <li>{ user }</li>
                        })
                    }
                </ul>
            </div>
            )
    }
}
